INSERT INTO `events` (`date`, `e_name`, `sno`, `poster`, `description`) VALUES
('2022-02-22', 'justice', 5, , 'Injustice anywhere is a threat to justice everywhere. We are caught in an inescapable network of mutuality, tied in a single garment of destiny. Whatever affects one directly, affects all indirectly. Our lives begin to end the day we become silent about things that matter. Speak up on this World Day of Social Justice and help to bring about a change.');
